import React from 'react';
import { Route } from "react-router-dom";
import HomePage from "./components/HomePage";


import './App.css';

function App() {
  return (
    <div className="App">
      <Route exact path="/" component={HomePage} />
      <Route path="/character-list" component={CharacterList} />

    </div>
  );
}

export default App;
